  false,\n\t\"url\": null,\n\t\"notes\": \"This data is for public use, and is in
  a GIS (Geographic Information Systems) form that displays farmers markets throughout
  California that are WIC (Women, Infants, and Children) certified. It contains infromation
  about the markets that have both FMNP (Farmers Market Nutritional Program) or FVC
  (Fruit and Vegetable Checks) certification, their WIC identification, locations,
  and when they are held. This was developed by the California Department of Technology,
  and information was gathered by the CDFA (California Department of Food and Agriculture).
  These locations were further specified and gathered by Carter Medlin, and edited
  by Lauren Phillips.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
